import "../sass/style.scss";
import { Link } from "react-router-dom";
import Copyright from "../images/copyrights.svg";

const Footer = () => (
  <>
    <div id="wrap">
      <div id="main" class="App clear-top d-flex footer">
        <Row>
          <Col>
            <img className="img-fluid col-centered" src={Copyright} />
            <p>2020 Hira Fareed</p>
          </Col>

          <Col>
            <p>hirafareedkapadia@gmail.com</p>
          </Col>

          <Col>
            <p>Behance</p>
            <p>LinkedIn</p>
            <p>Dribble</p>
          </Col>
        </Row>
      </div>
    </div>
    <footer class="footer"></footer>
  </>
);

export default Footer;
